(function() {
  var $main;

  $main = $("#ipcolour--main");

  $.get("https://ipinfo.io", function(response) {
    var s;
    s = response.ip.split(".");
    $main.text(response.ip);
    return $main.css("background", "rgba( " + s[0] + ", " + s[1] + ", " + s[2] + ", " + (s[3] / 255) + " )");
  }, "jsonp");

}).call(this);

